import React, { useEffect } from 'react';

function Header({history}) {

    const goHome = () => {
        history.replace("/");

        useEffect(() => {
            console.log(history);
            const unblock = history.block("응답한 결과가 전부 사라져요 🥲\n정말 시작 화면으로 가실건가요?");
            return () => {
                unblock();
            };
        }, [history]);
    };



    return (
        <div>
            <div className="Header">
                <div onClick={goHome}>투자 유니버스</div>
            </div>
        </div>
    );
}

export default Header;
